import React from 'react';
import PropTypes from 'prop-types';
import './DataCards.scss';

const DataCards = props => {
  const { data, actions } = props;
  let key = 0;
  const cards =
    data &&
    data instanceof Array &&
    data.map(depart => {
      key += 1;
      return (
        <div className="col col-12 col-lg-4 col-md-6 mb-3" key={key}>
          <button
            className="btn h-100  w-100 p-3  border data-card  "
            onClick={() => actions.onComponent(depart.userId, props)}
          >
            <div className="card-title">{depart.title}</div>
            {depart.body}
          </button>
        </div>
      );
    });
  return <div className="row cards">{cards}</div>;
};

DataCards.propTypes = {
  data: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired,
  actions: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired
};

export default DataCards;
